def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.2:
            priorities[i] = 1 / (1 + np.exp(-40 * (ratio - 0.2))) + 0.1
        elif ratio >= 0.2 and ratio < 0.4:
            priorities[i] = 1 / (1 + np.exp(-20 * (ratio - 0.3))) + 0.3
        elif ratio >= 0.4 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-15 * (ratio - 0.5))) + 0.4
        elif ratio >= 0.6 and ratio < 0.8:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 0.7))) + 0.5
        else:
            priorities[i] = 1 / (1 + np.exp(-5 * (ratio - 1))) + 0.6

        if i % 5 == 0:
            priorities[i] += 0.3
        elif i % 5 == 1:
            priorities[i] -= 0.2
        elif i % 5 == 2:
            priorities[i] += 0.25
        elif i % 5 == 3:
            for j in range(2):
                priorities[i] -= 0.1
        else:
            priorities[i] += 0.1

    return priorities
